/* disable blue filter and re-enable scroll bars*/
#container {
    filter: none !important;

    overflow: auto !important;
    overflow-x: auto !important;
    overflow-y: auto !important;

}

/* hide side add nag */
#userMessagingOverlay {
    display: none !important;
}


.global-modal {
    overflow: auto !important;
    overflow-x: auto !important;
    overflow-y: auto !important;
}

#userMessagingPostscript {
    overflow: auto !important;
    overflow-x: auto !important;
    overflow-y: auto !important;
}

.user-messaging.animate {
    overflow: auto !important;
    overflow-x: auto !important;
    overflow-y: auto !important;
}

html,body {
    overflow: auto !important;
    overflow-x: auto !important;
    overflow-y: auto !important;
}

/* hide overlay nags */
.reveal-overlay {
    display: none !important;    
}

#registerModal {
    display: none !important;    
}

/* Make Amazon a more tolerable place to visit */

/* buy buy buy? */
#cbcc_content_container {display:none !important;}

/* Top site bar */
#nav-upnav {display:none !important;}

/* Sponsored search results */
.amzn-safe-frame-container {display:none !important;}

/* Side touting */
#sc-rec-right {display:none !important;}

/* Bottom touting */
#sc-rec-bottom {display:none !important;}
#rhf {display:none !important;}

/* Checkout touting */
.adStripe2 {display:none !important;}

/* Move sign-out item up to top of menu instead of hidden at the bottom */
#nav-item-signout {position: absolute !important; 
                   top: 10px; 
                   right: 10px;}

#nav-item-signout > span {font-size:120% !important;
                          font-weight:bold !important;
                          color: #d97d0d !important;
                          text-decoration-line: underline; }

/* Fix broken, sidebar for calendar obscured by menu */
.page .calendar-wrapper.hide-sidebar .calendar-sidebar-nav {
    margin-left: 0 !important;
}

/* Move upload button up to top */

#import-data-start {
    position: absolute;
        top: 330px;
        left: 80px;
}

/* Reverse table order so last imported files are up top */
#dropzone-table {
    display: -webkit-flex; /* Safari */
    -webkit-flex-direction: column-reverse; /* Safari 6.1+ */
    flex-direction: column-reverse;
}

/* remove the div that prevents right-click-to-save-image */
._9AhH0 {display: none !important;}

/* remove the sign-up interstitial and scrollbar supression */
.RnEpo {display: none !important;}
body {overflow:unset !important;}

/* Hide recommend overlays */
.ytp-ce-covering-overlay {display: none !important;}
.ytp-ce-element  {display: none !important;}
.ytp-ce-video  {display: none !important;}

/* Hide interstitial */
[data-test-id="giftWrap"] {
  display:none;
} 

[data-test-id="fullPageSignupModal"] {
  display:none;
} 


/* re-enable scroll bar that interstitial tries to disable */
body {
    overflow:unset !important;
}
